import React, {Component} from 'react';
import './App.scss';

class Room extends Component {
    constructor(props) {
        super(props);

        this.state = {
            remoteParticipants: Array.from(this.props.room.participants.values())
        }
        this.leaveRoom = this.leaveRoom.bind(this);
    }
}

export default Room;
